import React from 'react';
import "../Styles/Navbar.css"
const Navbars = () => {
  return (
    <>
      <nav className="bg-gray-900">
        <div className="container mx-auto px-6 py-3">
          <div className="flex items-center justify-between">
            <div className="hidden w-full text-white text-2xl font-semibold lg:flex items-center">
              <a className="text-white no-underline hover:text-gray-300" href="#"><b>My News-App</b></a>
            </div>
            <div className="flex justify-between w-full lg:w-auto">
              <div className="flex flex-col lg:flex-row lg:items-center lg:space-x-12">
                <a className="text-gray-300 hover:text-white py-2 px-4 block" href="#">Home</a>
                <a className="text-gray-300 hover:text-white py-2 px-4 block" href="#">About</a>
                <a className="text-gray-300 hover:text-white py-2 px-4 block" href="#">News</a>
              </div>
            </div>
          </div>
        </div>
      </nav>
    </>
  );
};

export default Navbars;
